import axios from 'axios'
import React, { useEffect } from 'react'
import { baseURL } from '../index'

function Exchanges() {

     


     useEffect(()=>{
       
        const fetchExchanges= async ()=>{

              const {data}=await axios.get(`${baseURL}/exchanges`)

              console.log(data);

        }

        fetchExchanges();

     }, [])






  return (
    <div>Exchanges</div>
  )
}

export default Exchanges
